import React from 'react';
import { MDBTable, MDBTableHead, MDBTableBody } from 'mdb-react-ui-kit';
function Table({tableData}){
    return(
<table striped bordered hover>
            <thead>
                <tr>
                    <id>Id</id>
                    <th>Sample</th>
                    <th>Color</th>
                    <th>Comparison</th>
                    <th>Tiff files</th>
                    <th>Marker</th>

                </tr>
            </thead>
            <tbody>
            {
                tableData.map((data, index)=>{

                    return(
                        <tr key={index}>
                            <td>{index+1}</td>
                            <td>{data.sample}</td>
                            <td>{data.color}</td>
                            <td>{data.comparison}</td>
                            <td>{data.tiffs}</td>
                            <td>{data.marker}</td>


                        </tr>
                    )
                })
            }
            </tbody>
        </table>
    )
}
export default Table;
